import { ChangeEvent } from "react";
import './weather.css';
import { Content } from "../Content/Content";
import { getLocalTime } from "../../utils/getLocalTime";

export interface IWeather {
    onChange: (event: ChangeEvent<HTMLInputElement>) => void;
    onClick?: () => void;
    onKeyDown: (event: React.KeyboardEvent<HTMLInputElement>) => void;
    value: string;
    data?: IData;
    location: string;
    error: boolean;
}

export interface IData {
    data: {
        main: {
            temp: number,
            feels_like: number,
            humidity: number,
            pressure: number,
        },
        wind: {
            speed: number,
        },
        visibility: number,
        name: string,
        sys: {
            country: string
        },
        weather: [],
        timezone: number;
    }
}

export function Weather({onChange, onKeyDown, value, data, location, error}: IWeather) {
    const h1 = <h1>Hi</h1>;
    const h12 = document.createElement('h1');
    const ab = document.getElementsByTagName('h1')
    console.log(ab);
    return (
        <div className={
            data &&
                (getLocalTime(data.data.timezone) >= 7) && (getLocalTime(data.data.timezone) < 19)
                ? 'day weather__wrapper'
                : 'night weather__wrapper'
        }>
            <input
                placeholder={location}
                className="weather__input"
                type="search"
                defaultValue={value}
                onKeyDown={onKeyDown}
                onChange={onChange}
            />
            {h1}
            {error && 
                <p className="error__message">Request failed. Enter correct data and try again!</p>
            }
            {data && <Content data={data.data} />}
        </div>

    )
}
